social_posts.post_text:
Anyone who has listened to me on any platform knows how important it’s been to me that I try to show up as authentic and honest as possible. Whether it’s through humor or just raw vulnerability I try not to let personal judgement stop me from sharing my truth because I genuinely feel there’s value in public vulnerability especially for men where much of culture and society tell men that emotional vulnerability somehow makes them less of a man. Anyway, this new podcast endeavor has been profound for me. Thank you to any and everyone who listens and supports it means the world! ❤️

